import React from 'react';

const PostsList = (props) => {
    const posts = props.posts.map((post) => {
        return (
            <PostDetail key= {post._id} post={post} deletePost= {props.deletePost}/>
        )
    })

    return (
        <div>
            {posts}
        </div>
    )
}


export default PostsList;
